export default function Popup({appState, goal, breakdown}) {


    const numberArrows = (appState.length * 6) + (appState[appState.length-1].endValues.length)
    const goldPercent = (goal / numberArrows) * 100

    function filterBreakdown() {
        breakdown.filter(item => item === 0)
    }

    return (
        <div className="popup-container">
            <div className = "popup-box">
                <h3 className = "results-header gold">Gold Game Results</h3>
            </div>
        </div>
    )
}
